import React,{Component} from 'react';
import './App.css';
//import Locations from './Locations';
class nav extends Component
{

    Handler = (f) => 
    { 
        this.props.homeids(f);
    }
  
    render()
    {

return(
    <div id="navi">
    <div className="sidenav">
                    
                       <a href="#Home" id="homebtn" onClick={this.Handler.bind(1)} >Home</a>
                    
                   
                     <a href="#Locationid?" id="locbtn">Locations</a>
                     
                    </div>
    </div>
);
}
}
export default nav;
